import React from 'react' ;



export class Table extends React.Component {
    render() {
        const style ={ border : '1px solid black'}
        return (
            <div>
                <table >
                    <tr style={style}>
                        <th>Id</th>
                        <th>Name</th>
                        <th>Age</th>
                        <th>E-mail</th>
                        <th>Address</th>
                    </tr>
                </table>
            </div>
        );
    }
}
